pragma solidity 0.8.0;
import "./ED25519.sol";

contract SHA512 is ED25519 {

  uint[80]  K = 
            [ uint256(0x428a2f98d728ae22), 0x7137449123ef65cd, 0xb5c0fbcfec4d3b2f, 0xe9b5dba58189dbbc, 0x3956c25bf348b538, 
